var app=angular.module("hermes_app");app.controller("visualizar_sms",function(e,t,a){e.pagination={current_page:0,page_length:15,totalPages:function(){return e.lista_sms?Math.ceil(e.lista_sms.length/this.page_length):0},nextPage:function(){this.current_page+1<this.totalPages()&&this.current_page++},previousPage:function(){this.current_page-1>=0&&this.current_page--}},e.doSearch=function(){var n=new Date(e.search.startDate).getTime()/1e3,s=new Date(e.search.endDate).getTime()/1e3+86400;t({method:"get",url:"/api/sms/search/dateinterval",params:{start:n,end:s}}).then(function(t){e.lista_sms=t.data,toastr.info(e.lista_sms.length+" registros encontrados!")},function(e){a.handle(e),console.log(e)})}});